import {
  Box,
  Button,
  Container,
  IconButton,
  InputAdornment,
  Paper,
  TextField
} from '@material-ui/core';
import SearchIcon from '../../../icons/Search';
import XIcon from '../../../icons/X';

const Modal3 = () => (
  <Box
    sx={{
      backgroundColor: 'background.default',
      minHeight: '100%',
      p: 3
    }}
  >
    <Paper elevation={12}>
      <Box sx={{ p: 3 }}>
        <Box
          sx={{
            display: 'flex',
            justifyContent: 'flex-end'
          }}
        >
          <IconButton>
            <XIcon fontSize="small" />
          </IconButton>
        </Box>
      </Box>
      <Box sx={{ p: 3 }}>
        <Container maxWidth="md">
          <Box
            sx={{
              alignItems: 'center',
              display: 'flex'
            }}
          >
            <TextField
              fullWidth
              InputProps={{
                startAdornment: (
                  <InputAdornment position="start">
                    <SearchIcon fontSize="small" />
                  </InputAdornment>
                )
              }}
              placeholder="Search..."
            />
            <Button
              color="primary"
              size="large"
              sx={{ ml: 2 }}
              variant="contained"
            >
              Search
            </Button>
          </Box>
        </Container>
      </Box>
    </Paper>
  </Box>
);

export default Modal3;
